// From Brendan (https://stackoverflow.com/questions/71215903/how-can-i-properly-build-a-sin-lookup-table-with-c)
static float trig_sin(uint32_t angle) {
    if (angle & 2048) {
        if (angle & 1024) {
            // 3072 to 4095.
            return -trig_sinTable[4096 - angle];
        }
        // 2048 to 3071.
        return -trig_sinTable[angle - 2048];
    }
    if (angle & 1024) {
        // 1024 to 2047.
        return trig_sinTable[2048 - angle];
    }
    // 0 to 1023.
    return trig_sinTable[angle];
}

static inline float trig_cos(uint32_t angle) {
    return trig_sin((angle + 1024) & 4095);
}